import React, { useState } from 'react';
import { 
  Container, 
  Typography, 
  Box, 
  TextField, 
  Button, 
  Paper, 
  CircularProgress,
  Grid
} from '@mui/material';
import { styled } from '@mui/material/styles';
import config from './config';
import CloudUploadIcon from '@mui/icons-material/CloudUpload';

const StyledPaper = styled(Paper)(({ theme }) => ({
  padding: theme.spacing(4),
  margin: theme.spacing(4, 0),
  backgroundColor: '#ffffff',
  borderRadius: '12px',
  boxShadow: '0 4px 6px rgba(0, 0, 0, 0.1)',
}));

const StyledButton = styled(Button)(({ theme }) => ({
  borderRadius: '25px',
  padding: theme.spacing(1, 4),
  textTransform: 'none',
  fontWeight: 'bold',
}));

const StyledTextField = styled(TextField)({
  '& .MuiOutlinedInput-root': {
    borderRadius: '12px',
  },
});

function App() {
  const [file, setFile] = useState(null);
  const [prompt, setPrompt] = useState('');
  const [results, setResults] = useState(null);
  const [isLoading, setIsLoading] = useState(false);

  const handleFileUpload = (event) => {
    setFile(event.target.files[0]);
  };

  const handlePromptChange = (event) => {
    setPrompt(event.target.value);
  };

  const handleAnalyze = async () => {
    if (!file || !prompt) {
      alert('Please upload a file and enter a prompt');
      return;
    }

    setIsLoading(true);
    
    try {
      const formData = new FormData();
      formData.append('file', file);
      formData.append('prompt', prompt);

      const response = await fetch(`${config.apiUrl}/analyze`, {
        method: 'POST',
        body: formData,
      });

      if (!response.ok) {
        const errorData = await response.json();
        throw new Error(errorData.error || 'Unknown error occurred');
      }

      const data = await response.json();
      setResults(data.analysis);
    } catch (error) {
      console.error('Frontend error:', error);
      setResults('An error occurred during analysis: ' + error.message);
    } finally {
      setIsLoading(false);
    }
  };

  return (
    <Container maxWidth="md">
      <Typography variant="h3" component="h1" gutterBottom align="center">
        Resume Analyzer
      </Typography>
      <Typography variant="h6" gutterBottom align="center">
        Analyze your resume with AI and get personalized insights in minutes
      </Typography>
      
      <Paper elevation={3} style={{ padding: '20px', marginBottom: '20px' }}>
        <TextField
          fullWidth
          multiline
          rows={4}
          variant="outlined"
          label="Enter your analysis prompt"
          value={prompt}
          onChange={(e) => setPrompt(e.target.value)}
          style={{ marginBottom: '20px' }}
        />
        
        <Grid container spacing={2} alignItems="center">
          <Grid item xs={6}>
            <Button
              variant="contained"
              component="label"
              startIcon={<CloudUploadIcon />}
              fullWidth
            >
              Upload Resume
              <input type="file" hidden onChange={handleFileUpload} accept=".pdf,.doc,.docx" />
            </Button>
          </Grid>
          <Grid item xs={6}>
            <Button
              variant="contained"
              color="primary"
              onClick={handleAnalyze}
              disabled={isLoading || !file}
              fullWidth
            >
              {isLoading ? <CircularProgress size={24} /> : 'Analyze Resume'}
            </Button>
          </Grid>
        </Grid>
        
        {file && (
          <Typography variant="body2" style={{ marginTop: '10px' }}>
            File selected: {file.name}
          </Typography>
        )}
      </Paper>
      
      {results && (
        <Paper elevation={3} style={{ padding: '20px' }}>
          <Typography variant="h5" gutterBottom>
            Analysis Results
          </Typography>
          <Typography variant="body1" style={{ whiteSpace: 'pre-wrap' }}>
            {results}
          </Typography>
        </Paper>
      )}
    </Container>
  );
}

export default App;
